import React, { useState } from 'react';

interface Props {
  addTodo: (todoText: string) => void;
}

const NewTodo: React.FC<Props> = props => {
  const [todoText, setTodoText] = useState('');

  return (
    <div>
      <p>Todo text</p>
      <input type="text" id="todo-text" onChange={(event) => { event.preventDefault(); setTodoText(event.target.value); }} value={todoText} /><br />
      <button onClick={() => { props.addTodo(todoText); }}>ADD TODO</button>
    </div>
  );
}

export default NewTodo;
